import { useState } from 'react'

const CreatePark = (props) => {
  const [addPark, setAddPark] = useState({
    Park: '',
    Location: '',
    Category: '',
    Description: '',
    YearOpened: ''
  })
  let park = ''
  const handleChange = (e) => {
    // console.log(e.target.value)
    // console.log(e.target.name)
    // park = e.target.value
    setAddPark({ ...addPark, Park: e.target.value })
  }

  console.log(addPark)

  return (
    <div className="addPark">
      <h1>Add Park</h1>
      <form onSubmit={props.onSubmit}>
        <input
          type="text"
          name="Park"
          value={addPark.Park}
          placeholder="Park Name"
          onChange={(e) => setAddPark({ ...addPark, Park: e.target.value })}
        ></input>
        <input
          type="text"
          name="Location"
          // value={addPark.Location}
          placeholder="Location"
          onChange={() => handleChange()}
        ></input>
        <input
          type="text"
          name="Category"
          // value={addPark.Category}
          placeholder="Category"
          onChange={() => handleChange()}
        ></input>
        <input
          type="text"
          name="Description"
          // value={addPark.Description}
          placeholder="Description"
          onChange={() => handleChange()}
        ></input>
        <input
          type="text"
          name="YearOpened"
          // value={addPark.YearOpened}
          placeholder="Year Opened"
          onChange={() => handleChange()}
        ></input>
        <button className="submitButton" text="Submit">
          Add Park
        </button>
      </form>
    </div>
  )
}
export default CreatePark
